import React from "react";

import { VideoGaleryStyle } from "./VideoGaleryStyle";
import FontP from "../../styles/fontsStyles/fontP";
import Fonth2 from "../../styles/fontsStyles/Fonth2";


import opinion from "../../content/opinion.json"
import home from "../../content/home.json"



const VideoGalery = props => {
    const { title9 } = opinion;
    return (
        <VideoGaleryStyle >
            <div className="global">
                <div className="column1">

                </div>
                <div className="title">
                    <Fonth2> {title9}</Fonth2>
                </div>
                <div className="column2">
                    <div className="date">

                    </div>
                    <div className="circle">

                    </div>
                </div>
            </div>
        </VideoGaleryStyle>
    );
};

export default VideoGalery;
